const CHAINLINK_ORACLE_ABI = [
  {
    constant: true,
    inputs: [],
    name: "latestAnswer",
    outputs: [
      {
        name: "",
        type: "int256",
      },
    ],
    payable: false,
    stateMutability: "view",
    type: "function",
  },
  {
    constant: true,
    inputs: [],
    name: "latestTimestamp",
    outputs: [
      {
        name: "",
        type: "uint256",
      },
    ],
    payable: false,
    stateMutability: "view",
    type: "function",
  },
];

const ETHEREUM_ORACLE_ADDRESS = "0xF79D6aFBb6dA890132F9D7c355e3015f15F3406F";
const LINK_ORACLE_ADDRESS = "0x32dbd3214aC75223e27e575C53944307914F7a90";

export { ETHEREUM_ORACLE_ADDRESS, CHAINLINK_ORACLE_ABI, LINK_ORACLE_ADDRESS };
